    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["nom_dpt", "total_nuitees"];
    let aliases = ["D\u00e9partement", "Nuit\u00e9es"];
    let table = '<table>' +
        String(
        fields.map(
